import React, { useState } from 'react';

function GetQuote() {
  const [currentScreen, setCurrentScreen] = useState(1);
  const [formData, setFormData] = useState({
    projectType: '',
    projectDetails: {
      name: '',
      squareFootage: '',
      completionDate: '',
      materials: '',
      budget: '',
    },
  });

  const handleNext = () => setCurrentScreen((prev) => prev + 1);
  const handleBack = () => setCurrentScreen((prev) => prev - 1);

  return (
    <div className="min-h-screen flex items-center justify-center bg-[#F4F1DE]">
      {/* Screen 1: Project Type with Images */}
      {currentScreen === 1 && (
        <div className="p-6 bg-white rounded-lg shadow-md max-w-2xl w-full min-h-[70vh] min-w-[70vw]">
          <h2 className="text-3xl font-bold text-[#4A7A63] mb-4">Select Project Type</h2>
          <div className="grid grid-cols-2 gap-6">
            {[
              { name: 'Landscaping', image: '/images/landscaping.jpg' },
              { name: 'Irrigation', image: '/images/irrigation.jpg' },
              { name: 'Design', image: '/images/design.jpg' },
              { name: 'Maintenance', image: '/images/maintenance.jpg' },
            ].map((type) => (
              <div
                key={type.name}
                onClick={() =>
                  setFormData({ ...formData, projectType: type.name })
                }
                className={`relative rounded-lg overflow-hidden cursor-pointer text-center text-white shadow-md ${
                  formData.projectType === type.name
                    ? 'border-4 border-[#E07A5F] shadow-lg'
                    : 'hover:shadow-lg hover:shadow-[#4A7A63]/50'
                }`}
              >
                <img
                  src={type.image}
                  alt={type.name}
                  className="w-full h-32 object-cover"
                />
                <div
                  className={`absolute inset-0 flex items-center justify-center ${
                    formData.projectType === type.name
                      ? 'bg-[#E07A5F]/60'
                      : 'bg-black/40'
                  }`}
                >
                  <h3 className="font-bold text-lg">{type.name}</h3>
                </div>
              </div>
            ))}
          </div>
          <button
            onClick={handleNext}
            className="mt-6 w-full bg-[#E07A5F] text-white py-2 rounded hover:bg-[#d46653]"
          >
            Next
          </button>
        </div>
      )}

      {/* Screen 2: Project Details */}
    {currentScreen === 2 && (
      <div className="p-6 bg-white rounded-lg shadow-md max-w-lg w-full relative">
        <div className="absolute inset-0 rounded-lg bg-gradient-to-tr from-[#4A7A63] to-[#709c86] blur-xl opacity-30 z-[-1]"></div>
        <h2 className="text-3xl font-bold text-[#4A7A63] mb-6 text-center">
          Project Details
        </h2>

        {/* Project Name */}
        <div className="relative mb-4">
          <input
            type="text"
            placeholder="Project Name"
            value={formData.projectDetails.name}
            onChange={(e) =>
              setFormData({
                ...formData,
                projectDetails: {
                  ...formData.projectDetails,
                  name: e.target.value,
                },
              })
            }
            className="w-full px-4 py-2 bg-transparent border border-[#4A7A63] rounded shadow-md focus:outline-none focus:ring-2 focus:ring-[#E07A5F] placeholder-[#4A7A63] text-[#4A7A63]"
          />
          <div className="absolute inset-0 rounded bg-gradient-to-r from-[#E07A5F] to-[#d46653] blur-md opacity-50 pointer-events-none"></div>
        </div>

        {/* Square Footage */}
        <div className="relative mb-4">
          <input
            type="number"
            placeholder="Square Footage (e.g., 500)"
            value={formData.projectDetails.squareFootage}
            onChange={(e) =>
              setFormData({
                ...formData,
                projectDetails: {
                  ...formData.projectDetails,
                  squareFootage: e.target.value,
                },
              })
            }
            className="w-full px-4 py-2 bg-transparent border border-[#4A7A63] rounded shadow-md focus:outline-none focus:ring-2 focus:ring-[#E07A5F] placeholder-[#4A7A63] text-[#4A7A63]"
          />
          <div className="absolute inset-0 rounded bg-gradient-to-r from-[#E07A5F] to-[#d46653] blur-md opacity-50 pointer-events-none"></div>
        </div>

        {/* Preferred Completion Date */}
        <label className="block text-left text-[#4A7A63] mb-1 font-semibold">
          Preferred Completion Date
        </label>
        <div className="relative mb-4">
          <input
            type="date"
            value={formData.projectDetails.completionDate}
            onChange={(e) =>
              setFormData({
                ...formData,
                projectDetails: {
                  ...formData.projectDetails,
                  completionDate: e.target.value,
                },
              })
            }
            className="w-full px-4 py-2 bg-transparent border border-[#4A7A63] rounded shadow-md focus:outline-none focus:ring-2 focus:ring-[#E07A5F] text-[#4A7A63]"
          />
          <div className="absolute inset-0 rounded bg-gradient-to-r from-[#E07A5F] to-[#d46653] blur-md opacity-50 pointer-events-none"></div>
        </div>

        {/* Preferred Materials */}
        <label className="block text-left text-[#4A7A63] mb-1 font-semibold">
          Preferred Materials
        </label>
        <div className="relative mb-4">
          <select
            value={formData.projectDetails.materials}
            onChange={(e) =>
              setFormData({
                ...formData,
                projectDetails: {
                  ...formData.projectDetails,
                  materials: e.target.value,
                },
              })
            }
            className="w-full px-4 py-2 bg-transparent border border-[#4A7A63] rounded shadow-md focus:outline-none focus:ring-2 focus:ring-[#E07A5F] text-[#4A7A63]"
          >
            <option value="" className="text-gray-400">
              Select Materials
            </option>
            <option value="Gravel">Gravel</option>
            <option value="Soil">Soil</option>
            <option value="Turf/Grass">Turf/Grass</option>
            <option value="Stones">Stones</option>
            <option value="Paving Blocks">Paving Blocks</option>
          </select>
          <div className="absolute inset-0 rounded bg-gradient-to-r from-[#E07A5F] to-[#d46653] blur-md opacity-50 pointer-events-none"></div>
        </div>

        {/* Budget Range */}
        <label className="block text-left text-[#4A7A63] mb-1 font-semibold">
          Budget Range
        </label>
        <div className="relative mb-6">
          <input
            type="text"
            placeholder="e.g., $1000 - $5000"
            value={formData.projectDetails.budget}
            onChange={(e) =>
              setFormData({
                ...formData,
                projectDetails: {
                  ...formData.projectDetails,
                  budget: e.target.value,
                },
              })
            }
            className="w-full px-4 py-2 bg-transparent border border-[#4A7A63] rounded shadow-md focus:outline-none focus:ring-2 focus:ring-[#E07A5F] placeholder-[#4A7A63] text-[#4A7A63]"
          />
          <div className="absolute inset-0 rounded bg-gradient-to-r from-[#E07A5F] to-[#d46653] blur-md opacity-50 pointer-events-none"></div>
        </div>

        {/* Navigation Buttons */}
        <div className="flex justify-between">
          <button
            onClick={handleBack}
            className="bg-gray-400 text-white py-2 px-4 rounded shadow-md hover:bg-gray-500"
          >
            Back
          </button>
          <button
            onClick={handleNext}
            className="bg-[#E07A5F] text-white py-2 px-4 rounded shadow-md hover:bg-[#d46653]"
          >
            Next
          </button>
        </div>
      </div>
      )}


      {/* Screen 3: Review and Submit */}
      {currentScreen === 3 && (
        <div className="p-6 bg-white rounded-lg shadow-md max-w-lg w-full">
          <h2 className="text-2xl font-bold text-[#4A7A63] mb-4">Review Your Details</h2>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Project Type:</p>
            <p>{formData.projectType || 'Not Selected'}</p>
          </div>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Project Name:</p>
            <p>{formData.projectDetails.name || 'Not Provided'}</p>
          </div>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Square Footage:</p>
            <p>{formData.projectDetails.squareFootage || 'Not Provided'}</p>
          </div>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Preferred Completion Date:</p>
            <p>{formData.projectDetails.completionDate || 'Not Selected'}</p>
          </div>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Preferred Materials:</p>
            <p>{formData.projectDetails.materials || 'Not Selected'}</p>
          </div>
          <div className="mb-4">
            <p className="font-bold text-[#4A7A63]">Budget Range:</p>
            <p>{formData.projectDetails.budget || 'Not Provided'}</p>
          </div>
          <div className="flex justify-between">
            <button
              onClick={handleBack}
              className="bg-gray-400 text-white py-2 px-4 rounded hover:bg-gray-500"
            >
              Back
            </button>
            <button
              onClick={() => alert('Quote Submitted!')}
              className="bg-[#E07A5F] text-white py-2 px-4 rounded hover:bg-[#d46653]"
            >
              Submit
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default GetQuote;
